column6:
Prestação de serviço de manutenção preventiva e corretiva dos veículos da Secretaria de Assistência Social que atende a CENTRAL DE LIBRAS, com fornecimento de peças, compreendendo os serviços de mecânica completa, elétrico-eletrônico,lanternagem, pintura, suspensão, freios, balanceamento, alinhamento, cambagem, arrefecimento, reposição de fluídos e lubrificantes, reboque, lavagem e higienização. Aquisição de peças, pneus e demais materiais conforme edital.  Pelo período de 12 meses ( sendo este referente a 05 meses do exercício 2020 ).  Com o Valor homem-hora de R$ 139,00. 
Pregão Presencial nº 75/2019  -  Processo: 41455/19

Frota:
1) Renault Sandero, placa LRC 8776, tombamento nº 150062 Álcool/Gasolina, ano 2014;   
2) Renault Sandero, placa KRA 6098, tombamento nº 150078 Álcool/Gasolina, ano 2014;    
3) Chevrolet Spin, placa KXV 9912, Álcool/Gasolina, ano 2015;   
4) Chevrolet Spin, placa KXE 6338, tombamento nº 158671 Álcool/Gasolina, ano 2016;   
5) Chevrolet Spin, placa LSP 9717, tombamento nº 158672 Álcool/Gasolina, ano 2016;    
6) Chery Celer, placa LMH 1077, Álcool/Gasolina, ano 2015;    
7) Chery Celer, placa LMH 1078, ÁlcooChevrolet Spinl/Gasolina, ano 2015;    
8) Mercedes Sprinter, placa KXW 1264, tombamento nº 92722, ano 2006;   
9) Bora, placa LLF 9939, tombamento nº 101042 Álcool/Gasolina, ano 2010. 
10) Renault Master, placa LMP7C99, Diesel S10, ano 2018.

